Genre: Racing off-road cross-country
Developer : Smartmove
Publisher : Smartmove
Publication Type: license
Language: English
Screen Resolution : VGA / QVGA
Version: 1.02
System requirements: Processor 1000 Mhz. Android 2+ ARM7

Description : 4x4 Ofroad Trial Winter Racings game with realistic physics jeeps and beautiful snowy mountain slopes .
You need to pass through many obstacles , the frozen marshes, mountain snow-covered rocks and hard to reach areas !
Features:
- 3D graphics
- Physics jeeps, close to the real
- Diverse and unique snow-covered slopes
- Excellent performance on good devices and low resolution devices (including tablets )

